  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108098 includes chemical,
  discrete sample, physical and profile data collected from HESPERIDES in the North
  Atlantic Ocean from 2003-04-08 to 2003-04-24 and retrieved during cruise (HE091)
  and 29HE20030408. These data include ALKALINITY, DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Partial pressure (or fugacity)
  of carbon dioxide, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include CTD, Spectrophometer
  for pH measrement and bottle. These data were collected by Aida F. Rios of Instituto
  de Investigaciones Marinas; Departamento de Oceanograffa and R. Wanninkhof of US
  DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory as part of
  the CARINA/29HE20030408, CLIVAR FICARAM VI, CARINA FICARAM VI data set.nnThe International
  CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries out a systematic
  and global re-occupation of select WOCE/JGOFS hydrographic sections to quantify
  changes in storage and transport of heat, fresh water, carbon dioxide (CO2), and
  related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
